import React, { useState } from 'react'
import Icon from '../src/assets/icon.png'
import { Routes,Route } from 'react-router-dom'
import Auth from '../src/Pages/Auth'

const AllRoutes = () => {
    
  return (
    <Routes>
        <Route path='/Auth' element={<Auth/>}/>
    </Routes>     
  )
}

export default Auth
